INSERT INTO `stocks` (`StockID`, `Ticker`, `Company`, `Price`, `Exchange`, `Description`, `Time`) VALUES
(45, 'YHOO', 'Yahoo Inc.', '32.91', 'NasdaqNM', 'Yahoo Inc. Yahoo is a global technology company. Through the Companys technology and insights Yahoo delivers digital content and experiences across devices and globally. The Company provides online properties and services Yahoo Properties to users as well as a range of marketing services designed to reach and connect with those users on Yahoo and through a distribution network of third-party entities Affiliates. These Affiliates integrate its advertising offerings into their Websites or other offerings those Websites and other offerings Affiliate sites. Effective January 7 2014 Yahoo Inc acquired Aviate. Effective January 24 2014 Yahoo Inc acquired Cloud Party Inc. In February 2014 Yahoo Inc announced the expansion of its Champaign IL technology hub. Effective February 11 2014 Yahoo Inc acquired Wander LLC. Effective February 14 2014 Yahoo Inc acquired Distill. ', 1457019359),
(46, 'FB', 'Facebook, Inc.', '108.92', 'NasdaqNM', 'Facebook Inc. Facebook is engaged in building products to create utility for users developers and advertisers. People use Facebook to stay connected with their friends and family to discover what is going on in the world around them and to share and express what matters to them to the people they care about. Developers can use the Facebook Platform to build applications and Websites that integrate with Facebook to reach its global network of users and to build personalized and social products. It offers advertisers a combination of reach relevance social context and engagement. In September 2013 Mail.Ru Group Limited sold its remaining interest in Facebook Inc. Effective September 25 2013 Facebook Inc acquired Mobile Technologies a developer of online applications. In October 2013 Facebook Inc acquired Onavo Inc. Effective January 8 2014 Facebook Inc acquired Little Eye Software Labs Pvt Ltd. Effective January 13 2014 Facebook Inc acquired Branch Media Inc. ', 1457019359),
(49, 'CSCO', 'Cisco Systems, In', '26.71', 'NasdaqNM', 'Cisco Systems Inc. Cisco designs manufactures and sells Internet protocol IP-based networking and other products related to the communications and information technology IT industry and provide services associated with these products and their use. Its products are installed at enterprise businesses public institutions telecommunications companies commercial businesses and personal residences. The Company operates in three segments The Americas Europe Middle East and Africa EMEA and Asia Pacific Japan and China APJC. In July 2013 the Company announced that it has completed the acquisition of Composite Software Inc. In October 2013 Cisco Systems Inc completed the acquisition of Sourcefire Inc. In October 2013 the Company announced that it has completed the acquisition of privately held WHIPTAIL. In December 2013 Cisco Systems Inc completed the acquisition of privately held Insieme Networks. ', 1457019359),
(50, 'QQQ', 'PowerShares QQQ T', '105.22', 'NGM', 'PowerShares QQQ Trust Series 1 the Trust is a unit investment trust that issues securities called PowerShares QQQ Index Tracking Stock. The Trust holds all of the component securities of the Nasdaq-100 Index the Index. The Investment objective of the Trust is to provide investment results that generally correspond to the price and yield performance of the Nasdaq-100 Index. Invesco PowerShares Capital Management LLC is the Sponsor of the Trust and The Bank of New York Mellon is the Trustee. ', 1457019359),
(51, 'INTC', 'Intel Corporation', '30.70', 'NasdaqNM', 'Intel Corporation incorporated in 1968 designs and manufactures integrated digital technology platforms. A platform consists of a microprocessor and chipset. The Company sells these platforms primarily to original equipment manufacturers OEMs original design manufacturers ODMs and industrial and communications equipment manufacturers in the computing and communications industries. The Companys platforms are used in a range of applications such as personal computers PCs including Ultrabook systems data centers tablets smartphones automobiles automated factory systems and medical devices. The Company also develops and sells software and services primarily focused on security and technology integration. In February 2014 MA-COM Technology Solutions Holdings Inc announced that its subsidiary Mindspeed Technologies Inc completed the sale of assets of its wireless infrastructure business unit to Intel Corporation. ', 1457019359),
(52, 'MU', 'Micron Technology', '11.67', 'NasdaqNM', 'Micron Technology Inc. is a global manufacturer and marketer of semiconductor devices principally NAND Flash DRAM and NOR Flash memory as well as other memory technologies packaging solutions and semiconductor systems for use in computing consumer networking automotive industrial embedded and mobile products. In addition the Company manufactures semiconductor components for CMOS images sensors and other semiconductor products. The Company operates in four segments NAND Solutions Group NSG DRAM Solutions Group DSG Wireless Solutions Group WSG and Embedded Solutions Group ESG. The Companys product include NAND Flash Memory Dynamic Random Access Memory DRAM and NOR Flash Memory. The Companys manufacturing facilities are located in the United States China Israel Italy Malaysia Puerto Rico and Singapore. ', 1457019366),
(53, 'ORCL', 'Oracle Corporatio', '37.47', 'NYSE', 'Oracle Corporation is a provider of enterprise software and computer hardware products and services. The Company provides cloud services as well as software and hardware products to other cloud service providers both public and private. The Companys software business consists of two segments new software licenses and cloud software subscriptions and software license updates and product support. The Companys hardware systems business consists of two operating segments hardware systems products and hardware systems support. The Companys services business consists of the remainder of its operating segments and offers consulting services managed cloud services and education services. Effective March 13 2013 it acquired Nimbula Inc. Effective February 6 2014 Oracle Corp acquired the entire share capital of Responsys Inc. ', 1457019366),
(54, 'CMCSA', 'Comcast Corporati', '59.91', 'NasdaqNM', 'Comcast Corporation Comcast is a provider of entertainment information and communications products and services. The Company operates in five segments Cable Communications Cable Networks Broadcast Television Filmed Entertainment and Theme Parks. Cable Communications provides video high-speed Internet and voice services cable services to residential and business customers. Cable Networks consists primarily of its national cable television networks its regional sports and news networks its international cable networks its cable television production studio and its related digital media properties. Broadcast Television consists primarily of its NBC and Telemundo broadcast networks. Filmed Entertainment consists of the operations of Universal Pictures. Theme Parks consists primarily of its Universal theme parks in Orlando and Hollywood. In March 2014 Comcast Corp acquired FreeWheel Media Inc. In April 2014 Comcast Corp acquired the remaining 69 in Horror Entertainment LLC. ', 1457019366),
(55, 'SPLS', 'Staples, Inc.', '9.68', 'NasdaqNM', 'Staples Inc. Staples is an office products company. The Company operates in three business segments North American Stores  Online North American Commercial and International Operations. As of February 02 2013 the Company served businesses of all sizes and consumers in North America Europe Australia South America and Asia. The Companys North American Commercial segment consists of the United States and Canadian businesses that sell and deliver office products and services directly to businesses and includes Staples Advantage and Quill.com. The Companys International Operations segment consists of businesses in 23 countries in Europe Australia South America and Asia. The Company offers more than 10000 own brand products and services including an assortment of products with various environmental attributes which includes its Sustainable Earth brand products. In October 2013 Staples Inc completed the acquisition of Runa. ', 1457019366),
(56, 'AMAT', 'Applied Materials', '19.38', 'NasdaqNM', 'Applied Materials Inc. Applied provides manufacturing equipment services and software to the global semiconductor flat panel display solar photovoltaic PV and related industries. Applieds customers include manufacturers of semiconductor wafers and chips flat panel liquid crystal displays LCDs solar PV cells and modules and other electronic devices. These customers may use what they manufacture in their own end products or sell the items to other companies for use in advanced electronic components. Applied operates in four segments Silicon Systems Group Applied Global Services Display and Energy and Environmental Solutions. In November 2011 the Company acquired Varian Semiconductor Associates Inc. ', 1457019366),
(57, 'SYMC', 'Symantec Corporat', '19.99', 'NasdaqNM', 'Symantec Corporation is a security backup and availability solutions. The Companys products and services protect people and information in any digital environment from the smallest mobile device to the enterprise data center to cloud-based systems. The Companys software and services protect against advanced threats independent of the device and environment in which information is used or stored. The Company operated in five segments Consumer Security and Compliance Storage and Server Management Services and Other. The Companys segment provides identity protection and digital consumer data such as photos music and videos. The Security and Compliance solutions help businesses protect their information and systems. The Company delivers consulting education and dedicated support services. ', 1457019366),
(58, 'FOXA', 'Twenty-First Cent', '27.60', 'NasdaqNM', 'Twenty-First Century Fox Inc. formerly News Corporation is a diversified global media and entertainment company with operations in cable network programming television filmed entertainment direct broadcast satellite television and other corporate and eliminations. The Company has a portfolio of cable broadcast film pay television and satellite assets spanning six continents across the globe. The Company is home to a global portfolio of cable and broadcasting networks and properties including FOX FX FXX FS1 Fox News Channel Fox Business Network Fox Sports Fox Sports Network National Geographic Channels Fox Pan American Sports MundoFox STAR and 28 local television stations film studio Twentieth Century Fox Film and television production studios Twentieth Century Fox Television and Shine Group. Effective December 20 2013 the Company acquired Crowdflash Ltd. ', 1457019366),
(59, 'QCOM', 'QUALCOMM Incorpor', '52.30', 'NasdaqNM', 'QUALCOMM Incorporated Qualcomm is engaged in designing and manufacturing of digital communications products and services based on code division multiple access CDMA Orthogonal Frequency Division Multiplexing OFDMA and other technologies. The Company operates in four segments Qualcomm CDMA Technologies QCT Qualcomm Technology Licensing QTL Qualcomm Wireless  Internet QWI and Qualcomm Strategic Initiatives QSI. The Company develops and supply integrated circuits and system software based on CDMA OFDMA and other technologies for uses in voice and data communications networking application processing multimedia and global positioning system products. In November 2013 the Company sold its subsidiary Omnitracs Inc to Vista Equity Partners. ', 1457019366),
(62, 'TWTR', 'Twitter, Inc. Com', '19.21', 'NYSE', 'Twitter Inc. Twitter is a global platform for public self-expression and conversation in real time. Twitter is a real-time platform where any user can create a Tweet and any user can follow other users. Each Tweet is limited to 140 characters of text but can also contain rich media including photos videos and applications. Viewers can see photos videos and conversations directly in Tweets to get the whole story at a glance and all in one place. The Company offers Twitter apps for phones tablets and computers. The Company generates its advertising revenue primarily from the sale of its three Promoted Products Promoted Tweets Promoted Accounts and Promoted Trends. Its users include millions of people from around the world as well as influential individuals and organizations such as government officials celebrities athletes journalists sports teams media outlets and brands. In April 2014 Twitter Inc acquired Gnip Inc. ', 1457019366),
(63, 'NVDA', 'NVIDIA Corporatio', '32.36', 'NasdaqNM', 'NVIDIA Corporation NVIDIA is engaged in creating the graphics chips used in personal computers PCs. The Company operates in three segments graphics processing unit GPU Business professional solutions business PSB and consumer products business CPB. Its mobile processors are used in cell phones tablets and auto infotainment systems. Designers use GPUs to create visual effects in movies and create everything from golf clubs to jumbo jets. NVIDIA solutions are based on two technologies the GPU and the mobile processor. GPUs are the engines of visual computing the science and art of using computers to understand create and enhance images. It has three GPU product brands GeForce Quadro and Tesla. During the fiscal year ended January 29 2012 fiscal 2012 it acquired Icera Inc. In fiscal 2012 it launched Project Maximus. Effective July 29 2013 NVIDIA Corp acquired Portland Group Inc a wholesaler of parallel computing software from STMicroelectronics NV. ', 1457019366),
(64, 'SBUX', 'Starbucks Corpora', '58.24', 'NasdaqNM', 'Starbucks Corporation is a roaster marketer and retailer of coffee operating in 60 countries. The Company purchases and roasts coffees that it sells along with handcrafted coffee tea and other beverages and a variety of fresh food items through Company-operated stores. It also sells a variety of coffee and tea products and licenses its trademarks through other channels such as licensed stores and national foodservice accounts. As of September 30 2012 it operated 9405 Company-operated stores and 8661 licensed stores. It has four segments Americas Europe Middle East and Africa EMEA ChinaAsia Pacific CAP and Channel Development. In addition to its flagship Starbucks brand the Companys portfolio also includes Tazo Tea Seattles Best Coffee Starbucks VIA Ready Brew Starbucks Refreshers beverages and the Verismo System by Starbucks. In February 2013 Tata Coffee Ltd and the Company inaugurated a roasting and packaging plant in Karnataka. ', 1457019366),
(65, 'DTV', 'DIRECTV', '93.55', 'NasdaqNM', 'DIRECTV is a provider of digital television entertainment in the United States and Latin America. The Company operates two direct-to-home DTH operating segments DIRECTV U.S. and DIRECTV Latin America which are engaged in acquiring promoting selling andor distributing digital entertainment programming primarily via satellite to residential and commercial subscribers. It also owns and operates three regional sports networks RSNs and owns a 6o interest in Game Show Network LLC GSN a cable television network for game-related programming and Internet interactive game playing. DIRECTV Holdings LLC and its subsidiaries referred to as DIRECTV U.S. is the provider of DTH digital television services and a provider in the multi-channel video programming distribution MVPD industry in the United States. As of December 31 2011 DIRECTV U.S. had approximately 19.9 million subscribers. ', 1457019367),
(66, 'MSFT', 'Microsoft Corpora', '52.06', 'NasdaqNM', 'Microsoft Corporation is engaged in developing licensing and supporting a range of software products and services. The Company operates in five segments Windows  Windows Live Division Windows Division Server and Tools Online Services Division OSD Microsoft Business Division MBD and Entertainment and Devices Division EDD. The Companys products include operating systems for personal computers PCs servers phones and other intelligent devices server applications for distributed computing environments productivity applications business solution applications desktop and server management tools software development tools video games and online advertising. In September 2013 Ericsson completed the acquisition of Microsofts Mediaroom business and TV solution. Effective October 23 2013 Microsoft Corp acquired Apiphany Inc. Effective February 4 2014 Microsoft Corp acquired an undisclosed stake in Foursquare Labs Inc. ', 1457019367),
(67, 'GE', 'General Electric ', '30.34', 'NYSE', 'General Electric Company GE is a diversified technology and financial services company. The products and services of the Company range from aircraft engines power generation water processing and household appliances to medical imaging business and consumer financing and industrial products. It serves customers in more than 100 countries. Effective January 28 2011 it held a 49 interest in a media company that includes the NBC Universal businesses. Its segments include Energy Infrastructure Aviation Healthcare Transportation Home  Business Solutions and GE Capital. Effective January 1 2011 it reorganized the Technology Infrastructure segment into three segments Aviation Healthcare and Transportation. In April 2014 the Companys GE Healthcare acquired CHCA Computer Systems Inc. operating room OR management and analytics solutions provider. ', 1457019367),
(70, 'AAL', 'American Airlines', '41.68', 'NasdaqNM', 'American Airlines Group Inc. formerly AMR Corporation operates in the airline industry. The Companys principal subsidiary is American Airlines Inc. American. As of December 31 2011 American provided scheduled jet service to approximately 160 destinations throughout North America the Caribbean Latin America Europe and Asia. AMR Eagle Holding Corporation AMR Eagle a wholly owned subsidiary of the Company owns two regional airlines which do business as American Eagle-American Eagle Airlines Inc. and Executive Airlines Inc. collectively the American Eagle carriers. American also contracts with an independently owned regional airline which does business as AmericanConnection the AmericanConnection carrier. As of December 31 2011 AMR Eagle operated approximately 1500 daily departures offering scheduled passenger service to over 175 destinations in North America Mexico and the Caribbean. ', 1457019367);
